useEffect(() => {
  fetch(API_URL)
    .then(response => {
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      return response.json();
    })
    .then(json => {
      console.log('API Response:', json); // Add this line
      setData(json.records || []);
      setLoading(false);
    })
    .catch(err => {
      console.error('Error fetching data:', err); // Add this line
      setError(err.message);
      setLoading(false);
    });
}, []);
